import React from 'react';


const OutputList = ({ prediction, title, handlePrediction }) => {
    return (
      <div className="prediction-steps">
        <h2>{ title }</h2>
        <button onClick={() => handlePrediction(prediction.id)}>predict</button>
        {prediction.map(prediction => (
          <div className="prediction-preview" key={prediction.id} >
            <h2>{ prediction.title }</h2>
            <p>Written by { prediction.author }</p>
          </div>
        ))}
      </div>
    );
  }

  export default OutputList;
